column1:
zu "gesamte Tabelle":
Baden-Württemberg (ab 2002), Hessen (ab 2003): keine
Darstellung auf
Kreisebene möglich;
Nordrhein-Westfalen: Allgemeine Krankenhäuser;
Schleswig-Holstein: ohne Tages- und Nachtkliniken;
Bayern (bis 2000), Niedersachsen (bis 1999): einschl.
Bundeswehrkrankenhäusern;
Sachsen (1995): bezogen auf den Gebietsstand 01.01.1996

zu "aufgestellte Betten":
Rheinland-Pfalz (1995-2001): einschl. Plätzen von reinen
Tages- oder Nachtkliniken
